import styled from "styled-components";

export const StyledTexture = styled.div`
  display: flex;
  justify-content: center;
  margin: 10px;
  border: 1px solid #a5a4a7;
  border-radius: 3px;
  background-color: #d3d2d6;
  padding : 5px;

`;
